import React from 'react';
import Login from './Login Page/Login';
import Register from './Register Page/Register'
import { Router } from '@reach/router';

function App(props) {
    return(
        <Router>
            <Login path="/login" />
            <Register path="/register"/>
            <Game path="/register"/>
        </Router>
    );
}

export default App;
